import React, {Component} from "react";
import GalleryComponent from "../gallery/GalleryComponent";
import GenerateListContainer from "../shared/lists/GenerateListContainer";
import CardContainer from "../shared/cards/CardContainer";
import {CardGroup} from "semantic-ui-react";
import * as items from "../../constants/propObjectContainer";

class ReactSampleCode extends Component
{
	constructor ( props )
	{
		super( props );
		this.state = {
			isPortalOpen: false
		};
	}

	handlePortalClick = () => alert( 'hello ' )
	handlePortalClose = () => this.setState( {isPortalOpen: false} );

	render ()
	{
		const passToProps = {
			objectFromContainer: {...items.GALLERY_CARD_ITEMS},
			group: CardGroup,
			itemsPerRow: "3",
			wrapper: CardContainer,
		}
		const props = {card: <GenerateListContainer {...passToProps} />};

		return <GalleryComponent {...props} />;
	}
}

export default ReactSampleCode;
